    "projectMore": "Il progetto MoreThanAJob promuove lo sviluppo di meccanismi di cooperazione tra attori dell’Economia Sociale e Solidale e la pubblica amministrazione per migliorare l’erogazione di servizi di welfare per soggetti vulnerabili al fine di migliorare le loro opportunità di inclusione socio-lavorativa.\n" + "Migliorare la cooperazione tra questi due attori e le loro diverse realtà migliorerà lo sviluppo di servizi innovativi e più efficienti che siano in grado di rispondere alle sfide attuali delle nostre società, in particolar modo a seguito dell’emergenza legata alla diffusione del Covid-19. Questa emergenza ha, infatti, evidenziato come un solido sistema di welfare sia essenziale per proteggere le fasce più deboli, garantire società più eque e assicurare che ogni cittadino abbia gli stessi diritti e opportunità.\n" + "MoreThanAJob cambierà il modo in cui gli attori dell'Economia Sociale e Solidale e le pubbliche amministrazioni collaborano per l’erogazione di servizi a soggetti vulnerabili attraverso lo sviluppo di un modello di nuove iniziative pilota di welfare, nonché lo sviluppo di policy briefs e raccomandazioni politiche per migliorare la pianificazione di politiche adattate ai bisogni dei beneficiari.\n" + "Il progetto è finanziato dal programma ENI CBC 2014-2020 e coinvolge partner di 5 paesi diversi: Palestina, Giordania, Libano, Grecia e Italia.\n",
